script: |
  super -f text -I q11966.spq | sort > q11966.out

inputs:
  - name: q11966.spq
    data: |
      SELECT DISTINCT - col0 AS col0, + col2 FROM tab1 (FORMAT parquet) cor0 WHERE NULL IS NULL OR + - col0 + + - col2 NOT BETWEEN + col0 / col1 - + - 83 + - ( col0 ) AND col0;
  - name: tab1

outputs:
  - name: q11966.out
    data: |
      -51	96
      -85	59
      -91	68
